//       <Discover></Discover>
//       <Features />
//       <Contact />
//       {/* <Landing></Landing> */}
//     </div>
//   );
// }

function App() {
  return (
    <main>
      <Switch>
        <Route path="/" component={Discover} exact />
        <Route path="/privacy" component={PrivacyPolicy} />
        <Route path="/terms" component={TermsConditions} />
      </Switch>
    </main>
  );
}

export default App;
